  Furbearer Management Plan directs the management and regulation of trapping. The
  furbearer management program directly supports the environmental health, wildlife,
  habitat, and recreational usage goals of the Refuge. Furbearers included in this
  plan are muskrat, mink, raccoon, opossum, red fox, gray fox, beaver, skunk, weasel,
  and coyote.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
